function App() {
  return (

    <div className="h-screen flex justify-center items-center flex-col gap-y-6 flex-wrap dark:bg-gray-900 bg-white">
		<div className="intro">Esta Network</div>
		<div className="tagline"><p id="spam"></p></div>
    <div className="row">
    <GenericFasIcon icon={faDiscord} size="2x" tooltip="JavaScript, 2 years (began July 2019)" />
    <GenericFasIcon icon={faShoppingCart} size="2x" tooltip="JavaScript, 2 years (began July 2019)" />
    <a target="_blank" href="https://namemc.com/esta.land"><i class="icon-minecraft"></i></a>



     </div>
    </div>

  );

}

export default App;
